                QUICKPAYUS provides services in foreign exchange, commodities,
                stocks, stock indexes and other products through professional
                traders working aligned with years of experienced market
                analysts.
              </p>
              <button className="btn btn-success">learn more</button>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
